class Register extends Component {

    render() {
        return (
            <div className="container_Register">
                <div className="Register">
                    {/* <div className="Container_Buttoms"></div> */}
                    <Imgg imagen={"Img_Background_Register"} />
                    <FormReg />
                </div>

            </div>

        )
    }

}

export default Register;
